import React from 'react'
import { AppBar, Toolbar, IconButton, Typography, ButtonGroup, Button, Stack, styled } from '@mui/material'

import MenuIcon from '@mui/icons-material/Menu';

const navbar = () => {

    const styledToolbar = styled(Toolbar)({
        display: "flex"
    })

    const styledTypography = styled(Typography)({
        alignContent: "center"
    })

    const styledButtonGroup = styled(Typography)({
        alignContent: "flex-end"
    })



    const buttons = [
        <Button key="one">One</Button>,
        <Button key="two">Two</Button>,
        <Button key="three">Three</Button>,
    ];

    return (
        <div >

            <AppBar>
                <styledToolbar variant="dense">

                    <styledTypography variant="h6" color="inherit" component="div">
                        Ezekiel Norman
                    </styledTypography>


                    <styledButtonGroup color = "secondary" size="large" aria-label="large button group" >
                        {buttons}
                    </styledButtonGroup>       
                </styledToolbar>

            </AppBar>
        </div>
    )
}

export default navbar
